import React from 'react';
import ReactDOM from 'react-dom';

class App extends React.Component{
  renderSquare = (value) => {
  // this.state.data =this.state.value;
  this.setState({value:value});

    console.log("value",this.state.value);
    for (var i = 0; i < 9; i++) {

       this.setState({data:this.state.value});
    }    

    console.log("data",this.state.data);
    // return <square value={i} />;

  }

  onChangeValue = (e) => {
    this.setState({value : e.target.value});
    // this.setState({data: e.target.value});
  }


  render() {
    console.log("data",this.state.data);
    return(
      <div>
        {/* <button className="square"></button> */}
        <input type="text" value={this.state.value} onChange={this.onChangeValue}/>
        <button  onClick={this.renderSquare.bind(this)}>Submit</button>

       <div>
       <table id="square">
        <tbody>
          <tr id="row0">
            <td id="cell0-0">{this.state.data[0]}</td>
            <td id="cell0-1">{this.state.data[1]}</td>
            <td id="cell0-2">{this.state.data[2]}</td>
          </tr>
          <tr id="row1">
            <td id="cell1-0">2</td>
            <td id="cell1-1">4</td>
            <td id="cell1-2">6</td>
          </tr>
          <tr id="row2">
            <td id="cell2-0">7</td>
            <td id="cell2-1">8</td>
            <td id="cell2-2">9</td>
          </tr>
        </tbody>
      </table>
       </div>
      </div>

    );

  }
}
export default App;
